import React, { Component } from 'react';
import '../css/SocialFollow.css';

const fbIcon = "../images/fbIcon.png";
const igIcon = ".././images/igIcon.png";
const yelpIcon = ".././images/yelpIcon.png";
const fbLink = "https://www.facebook.com/groups/331733583546961/"

class SocialFollow extends Component{
    render(){
        return(
            <div className="Social">
              <ul>
                <SocialIcon icon={fbIcon} link={fbLink}/>
                <SocialIcon icon={igIcon} link={igLink}/>
                <SocialIcon icon={yelpIcon} link={yelpLink}/>

                <li><a href="www.mail.google.com"><i class="fas fa-envelope-open-text"></i> Subscribe</a></li>
              </ul>
            </div>
        );
    }
}


const SocialIcon = props => {
  <li>
    <a href={props.link}>
      <img src={props.icon}></img>
    </a>
  </li>
}

export default SocialFollow;
